var location;
var code;
main();

function main(){
  location = 5;
  code = '';
  var input = "\n\
\n\
\n\
\n\
\n"
  for(let i in input){
    // console.log(input[i]);
    move(input[i]);
  }
  console.log(code);
}

function move(direction){
  switch(direction){
    case 'U':
      if(location > 3){
          location = location - 3;
      }
      break;
    case 'R':
      //if not at end move right
      if(location % 3 != 0){
        location = location + 1;
      }
      break;
    case 'D':
      if(location < 7){
        location = location + 3;
      }
      break;
    case 'L':
      if(location % 3 != 1){
        location = location - 1;
      }
      break;
    case '\n':
      code += location;
  }
}
